description:
Preconfigured Items:
• The App_Data folder with updated path to dataFolder variable;
• Sitecore settings for scaled environment;
• Sitecore SQL Server Session State provider.

Features:
• Rebuild Search Indexes on very first start of a WebRole Instance.

Simplified Chinese PinYin Conversion Class Library.

using System;

string chineseWords = "世界你好";
string full = chineseWords.ToPinYin();     // output: SHIJIENIHAO
string abbr = chineseWords.ToPinYinAbbr(); // output: SJNH

